import { Component } from '@angular/core';

@Component({
  selector: 'app-navbar',
  templateUrl: './navbar.component.html',
  styleUrls: ['./navbar.component.css']
})
export class NavbarComponent {

}
<ul>
  <a routerLink="/">Home</a>
  <a routerLink="/lancamento">Lançamento</a>
  <a routerLink="/calendario">Calendário</a>
</ul>
